sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...
  if(inputs.status_code == "200"){
   const response = JSON.parse(inputs.response_body);
   outputs.city = response.city
   outputs.region = response.region
   outputs.country = response.country
   var arr = response.loc.split(',');
   outputs.latitude = arr[0]
   outputs.longitude = arr[1]
  }
})(inputs, outputs);

